webpackJsonp([96078698428502],{337:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Stephen Quick",author:"Stephen Quick"}},markdownRemark:{id:"c:/Users/stephen/Documents/Git/stepquick.github.io/src/pages/how-to-remove-mysql-installation-on-mac/index.md absPath of file >>> MarkdownRemark",html:'<p>Note: Original article from 2012, I don’t use MAMP anymore, I use a vagrant/local mysql installation via homebrew.</p>\n<p>I don’t know if this is important anymore, the original article I linked to is broken, but here’s the original commands:</p>\n<div class="gatsby-highlight">\n      <pre class="language-text"><code class="language-text">sudo rm /usr/local/share/mysql\nsudo rm -rf /usr/local/share/mysql*\nsudo rm -rf /Library/StartupItems/MySQLCOM\nsudo rm -rf /Library/PreferencePanes/My*\nedit /etc/hostconfig and remove the line MYSQLCOM=-YES-\nsudo rm -rf /Library/Receipts/mysql*\nsudo rm -rf /Library/Receipts/MySQL*\nsudo rm -rf /var/db/receipts/com.mysql.*</code></pre>\n      </div>\n<p>This is for when MAMP is used for your web server purposes. It might work for overall mysql installations(mysql is under the share folder after all), but it’s been a while since I’ve used MAMP. I’m going to make it a point to actually update my articles in the future.</p>\n<p>Tip:\nUse this command to find everything related to mysql.</p>\n<div class="gatsby-highlight">\n      <pre class="language-text"><code class="language-text">sudo find / | grep -i mysql</code></pre>\n      </div>',frontmatter:{title:"How to remove MySQL installation on Mac",date:"February 17, 2014"}}},pathContext:{slug:"/how-to-remove-mysql-installation-on-mac/",previous:null,next:{fields:{slug:"/rvm-troubles-on-mac/"},frontmatter:{title:"RVM missing on Mac"}}}}}});
